import React from 'react'
import './assets/css/base/base.css'
import Home from './paginas/Home'
import Agencias from './paginas/Agencias'

function App() {
  const Router = () => {
    const locarion = window.location.pathname
    if (location === '/agencias') {
      return <Agencias />
    } else {
      return <Home />
    }
  }

  return (
  <>
    { Router() }
  </>
  )
}

export default App
